import {ITask} from "../../../shared/interfaces/ITask";
import React from 'react';
import './tasks.scss';

interface TaskProps {
    task: ITask;
}

const Task: React.FunctionComponent<ITask> = (taskProps: TaskProps) => {
    return (
        <div className="task-wrapper">
            <div className="task-wrapper_item">
                <span className="task-wrapper_item__name">
                    {taskProps.task.title}
                </span>
            </div>
            <div className="task-wrapper_item">
                <span className="task-wrapper_item__name">
                    {taskProps.task.scheduled}
                </span>
            </div>
            <div className="task-wrapper_item">
                <span className="task-wrapper_item__name">
                    {taskProps.task.assignTo? taskProps.task.assignTo : 'select driver'}
                </span>
            </div>
            <div className="task-wrapper_item">
                <span className="task-wrapper_item__name">
                    {taskProps.task.address}
                </span>
            </div>
            <div className="task-wrapper_item">
                <span className="task-wrapper_item__name">
                    {taskProps.task.location.longitude}, {taskProps.task.location.latitude}
                </span>
            </div>
        </div>
    )
};

export default Task;
